import React from "react";

function Footer() {
  return (
    <div id="contactMe">
      <div>
        <h1>Contact Me!</h1>
      </div>
      <div className="mailFavDiv">
        <a href="mailto:divad.ekioz@web.de">
          <i className="fa-solid fa-2xl mailFav fa-envelope"></i>
        </a>
      </div>
    </div>
  );
}

export default Footer;
